import React from 'react'
import "../Searchcomp.css"
import  TuneIcon  from '@material-ui/icons/Tune';
import Channel from '../components/Channel';

function SearchComp() {
  return (
    <div className='Searchpage'>
    <div className='search_filter'>
    <TuneIcon/>
    <h2>Filter</h2>
    </div>
    <hr/>

    <Channel
    image="https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn.vox-cdn.com%2Fthumbor%2FElnzjjbS376s3BFUCnFrsyjBArA%3D%2F0x86%3A706x557%2F1400x1050%2Ffilters%3Afocal(0x86%3A706x557)%3Aformat(png)%2Fcdn.vox-cdn.com%2Fassets%2F738480%2Fstevejobs.png&imgrefurl=https%3A%2F%2Fwww.theverge.com%2F2011%2F10%2F27%2F2517152%2Fbook-review-steve-jobs-by-walter-isaacson&tbnid=nZq2rgl9YdRCnM&vet=12ahUKEwigpdi-6Kr3AhXIRM0KHVpnBfUQMygCegUIARDaAQ..i&docid=eeF8bxcs36rMCM&w=1400&h=1050&q=steve%20jobs&ved=2ahUKEwigpdi-6Kr3AhXIRM0KHVpnBfUQMygCegUIARDaAQ"
    channel="you are cool "
    subs="678K"
    numofvideos={2} 



    />





    </div>
  )
}

export default SearchComp
